<?php

class DebugManager extends DebugToolBuilder {
    public function ToolBar() {
        $Builder = new DebugToolBuilder();

        $DEBUGGER_ID = $Builder->getDebugId();

        /** Logo */
        $Builder->Btn('<img src="data:image/png;base64," style="width: 100%;">', '', 'version');

        /** Version du framework */
        $Builder->Btn('<i class="fa fa-code-fork" aria-hidden="true"></i> 1-Release', '', 'version');

        /** Time to first byte Monitor */
        $Builder->Btn('<i class="fa fa-clock-o" aria-hidden="true"></i> TTFB: ' . $this->getTTFB() . ' ms', 'color:' . $this->valueToColor($this->getTTFB(), 600) . '', 'ttfb');

        /** Mysql Query Monitor */
        $Mysql_Debugger = new DebugMySQL();
        $Mysql_Debugger = $Mysql_Debugger->getDebugger();

        if ($Mysql_Debugger['global']['countError'] != 0) {
            $Builder->Btn('<i class="fa fa-cloud-download" aria-hidden="true"></i>Requêtes (' . $Mysql_Debugger['global']['countRequest'] . ')', 'color:#DF0101', 'query');
        } else {
            if ($Mysql_Debugger['global']['countWarning'] != 0) {
                $Builder->Btn('<i class="fa fa-cloud-download" aria-hidden="true"></i> Requêtes (' . $Mysql_Debugger['global']['countRequest'] . ')', 'color:#7AE87A', 'query');
            } else {
                $Builder->Btn('<i class="fa fa-cloud-download" aria-hidden="true"></i> Requêtes (' . $Mysql_Debugger['global']['countRequest'] . ')', 'color:#7AE87A', 'query');
            }
        }
        global $ERROR_LOGGER_COUNT, $ERROR_LOGGER;
        if($ERROR_LOGGER_COUNT != 0) {
            $Builder->Btn('<i class="fa fa-remove" aria-hidden="true"></i>Erreur (' . $ERROR_LOGGER_COUNT . ')', 'color:#DF0101', 'phperror');
        } else {
            $Builder->Btn('<i class="fa fa-remove" aria-hidden="true"></i> Erreur (' . $ERROR_LOGGER_COUNT . ')', 'color:#7AE87A', 'phperror');
        }


        $Builder->Btn('<i class="fa fa-eye" aria-hidden="true"></i> Informations', 'color:#7AE87A', 'infos');


        $Builder->Btn('<i class="fa fa-exchange" aria-hidden="true"></i> Log', 'color:#7AE87A', 'log_page');

        $Builder->Panel('log_page', function () use ($DEBUGGER_ID) {
            global $ERROR_LOGGER_GLOBAL;
            $p = null;
            $i = 0;
            foreach($ERROR_LOGGER_GLOBAL as $GLOG) {
                $p .= '<div style="" class="line-' . $DEBUGGER_ID . '">'.$i.' -> '.$GLOG.'</div>';
                $i++;
            }

            return $p;
        });
        
        $Builder->Panel('infos', function () use ($DEBUGGER_ID) {
            $p = null;
            ob_start();
            var_dump($_SERVER);
            $SERVER_INFO = ob_get_clean();

            ob_start();
            var_dump($_POST);
            $_POST_INFO = ob_get_clean();


            ob_start();
            var_dump($_GET);
            $_GET_INFO = ob_get_clean();

            ob_start();
            var_dump($_SESSION);
            $_SESSION_INFO = ob_get_clean();

            ob_start();
            var_dump($_COOKIE);
            $_COOKIE_INFO = ob_get_clean();

            $p .= '<div style="" class="line-' . $DEBUGGER_ID . '"><h4>Variable SERVEUR</h4><br><pre>'.$SERVER_INFO.'</pre></div>';

            $p .= '<div style="" class="line-' . $DEBUGGER_ID . '"><h4>Variable GET</h4><br><pre>'.$_GET_INFO.'</pre></div>';

            $p .= '<div style="" class="line-' . $DEBUGGER_ID . '"><h4>Variable POST</h4><br><pre>'.$_POST_INFO.'</pre></div>';

            $p .= '<div style="" class="line-' . $DEBUGGER_ID . '"><h4>Variable SESSION</h4><br><pre>'.$_SESSION_INFO.'</pre></div>';

            $p .= '<div style="" class="line-' . $DEBUGGER_ID . '"><h4>Variable COOKIE</h4><br><pre>'.$_COOKIE_INFO.'</pre></div>';
            return $p;
        });



        $Builder->Panel('phperror', function () use ($ERROR_LOGGER, $DEBUGGER_ID) {
            $p = null;
            if(is_array($ERROR_LOGGER)) {
                foreach ($ERROR_LOGGER as $PHPERROR) {
                    $p .= '<div style="color:' . $PHPERROR['color'] . '" class="line-' . $DEBUGGER_ID . '">' . $PHPERROR['error'] . '</div>';
                }
            }




            return $p;
        });



        $Builder->Panel('query', function () use ($Mysql_Debugger, $DEBUGGER_ID) {
            $p = null;
            if (isset($Mysql_Debugger['request'])) {
                if (is_array($Mysql_Debugger['request'])) {
                    foreach ($Mysql_Debugger['request'] as $Query_Info) {
                        if (!$Query_Info['error']) {
                            if (!$Query_Info['warning']) {
                                $p .= '<div title="Execution en ' . $Query_Info['time'] . ' ms" style="color:#00FF00" class="line-' . $DEBUGGER_ID . '">' . $Query_Info['final_query'] . '</div>';
                            } else {
                                $p .= '<div title="WARNING : ' . $Query_Info['warning'] . ' || Execution en ' . $Query_Info['time'] . ' ms" style="color:#DF7401" class="line-' . $DEBUGGER_ID . '">' . $Query_Info['final_query'] . '</div>';
                            }
                        } else {
                            $p .= '<div title="ERROR : ' . $Query_Info['error'] . '" style="color:#DF0101" class="line-' . $DEBUGGER_ID . '">' . $Query_Info['final_query'] . '</div>';
                        }
                    }
                }
            }
            return $p;
        });

        return $Builder->Result();
    }

    private function Request($GLOBAL_QUERY, $GLOBAL_QUERY_ARG, $GLOBAL_QUERY_TIME, $DEBUG_UID, $GLOBAL_QUERY_ERROR) {
    }

    private function getTTFB() {
        global $GLOBAL_time_start;
        $time_end = microtime(true);
        $load_time = number_format(number_format($time_end - $GLOBAL_time_start, 20) * 1000);

        return $load_time;
    }

    public function valueToColor($value, $max, $min = 0) {
        $load_time = 1;
        $color = '#7AE87A';
        if ($load_time >= 31) {
            $color = '#C8FE2E';
        }

        if ($load_time >= 70) {
            $color = '#F7BE81';
        }

        if ($load_time >= 140) {
            $color = '#FE642E';
        }

        if ($load_time >= 250) {
            $color = '#FF4000';
        }

        if ($load_time >= 350) {
            $color = '#DF0101';
        }
        return $color;
    }

}